// Abort if already created
if ($wpdb->get_var("SHOW TABLES LIKE 'wp_events_lat_lng'")) {
	exit;
}

// Create lat/lng cache/lookup table
$wpdb->query("
CREATE TABLE `wp_fb_posts_lat_lng` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` int(11) unsigned NOT NULL,
  `lat` varchar(15) NOT NULL DEFAULT '',
  `lng` varchar(15) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `post_id` (`post_id`),
  KEY `lat` (`lat`),
  KEY `lng` (`lng`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
");

# Create zip lat/lng lookup table
